import React, { useState } from 'react';
import Nav from './components/Nav';
import About from './components/About';
import Contact from './components/Contact'

function App() {
    const [currentTab, setCurrentTab] = useState("about")

    const renderTab = () => {
      switch (currentTab) {
        case "about":
          return <About />;
        case "portfolio":
          return <Portfolio />;
        case "contact":
          return <Contact />;
        case "resume":
          return <Resume />;
        default:
          return null;
      }
    };
  return (
    <div className="App">
      <Contact></Contact>
      <Nav></Nav>
      <About></About>

    </div>
  );
}

export default App;
